import "./App.css";
import { BrowserRouter, Router, Routes, Route } from "react-router-dom";
import Main from "./main/Main";
import Join from "./join/Join";

function App() {
  return (
    <>
      <BrowserRouter>
        <Router>
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/join" element={<Join />} />
          </Routes>
        </Router>
      </BrowserRouter>
    </>
  );
}

export default App;
